  function onclick(){
    console.log("running onclick functions");
     setclicked(true)
     console.log("onclicked",onclicked)
  }
  return (<>
    <Header onclick={onclick}/>
    {console.log(onclicked)}
    {clicked===true? <Header onclick={onclick}/> : ('nothing')}
  </>
  );
}

